import React, { useState, useEffect } from 'react';
import { MdAdd } from 'react-icons/md';

import { Container, DeliverymanContent, Table } from './styles';
import HeaderList from '../../components/HeaderList';
import SearchInput from '../../components/Search';
import IconButton from '../../components/IconButton';
import api from '../../services/api';
import EntregadoresTabela from './EntregadoresTabela';

export default function Entregadores() {
  const [deliveryman, setDeliveryman] = useState([]);
  const [page] = useState(1);

  useEffect(() => {
    async function loadDeliveryman() {
      const response = await api.get('deliveries', {
        params: page,
      });

      setDeliveryman(response.data);
    }
    loadDeliveryman();
  }, [page]);

  async function handleSearch(e) {
    const response = await api.get('deliveries', {
      params: {
        q: e.target.value,
      },
    });

    setDeliveryman(response.data);
  }

  return (
    <Container>
      <DeliverymanContent>
        <HeaderList title="Gerenciando Entregadores">
          <SearchInput
            type="text"
            placeholder="Buscar por entregadores"
            onChange={handleSearch}
          />
          <IconButton Icon={MdAdd} title="CADASTRAR" type="button" />
        </HeaderList>
        <Table>
          <section>
            <strong>ID</strong>
            <strong>Foto</strong>
            <strong>Nome</strong>
            <strong>Email</strong>
            <strong>Ações</strong>
          </section>
        </Table>
        {
          (console.tron.log(deliveryman),
          deliveryman.map(deli => (
            <EntregadoresTabela key={deli.id} data={deli} />
          )))
        }
      </DeliverymanContent>
    </Container>
  );
}
